INSERT INTO `empresa` (`id_empresa`, `que_hacemos`, `historia`, `aviso_legal`, `politicas`, `aviso_cookies`, `condiciones_contrato`, `desestimiento`, `created_at`, `updated_at`) VALUES (1,'Nuestra empresa es fabricante de uniformidad, prendas técnicas, deportes, alta montaña, etc. Además, somos distribuidores de las principales marcas de productos del sector, como por ejemplo: CRISPI BOOTS, MARS ARMOR, KING COBRA, MAGNUM BOOTS, FAL, SAFARILAND, ESP, TCH, VEGA HOLSTER, ETC. De este modo, podemos ofrecer a nuestros clientes gran diversidad de productos de las principales marcas del mercado con el mejor precio y calidad.','En Danner Uniforms, con más de 20 años de experiencia en el sector, creemos firmemente en la mejora continua. Potenciando la atención personalizada a través de la web y nuestra plataforma online para realizar los pedidos de forma más directa y ágil, aportamos una diferenciación en el sector.\n\nNuestros productos presentan una calidad en el acabado, durabilidad y diseño que nos sitúa como referentes en el mercado. La fabricación de casi el 100% de los productos se realiza in house, y nos garantiza la trazabilidad de nuestros productos asi como el control sobre la producción y un precio muy competitivo en el mercado.\n\nLa ropa técnica y laboral que ponemos a tu disposición son de primera calidad; diseñamos y producimos bajo demanda, personalizando todos nuestros productos. Estamos muy orientados al cliente por el alto grado de conocimiento del sector desde hace más de 20 años.\n\nEl asesoramiento es uno de los pilares sobre los que basamos nuestro buen hacer, estableciendo una relación más comprometida con el cliente.','Los términos y condiciones recogidos en el presente Aviso Legal (en adelante, las “Normas”) tienen por finalidad informar, regular el uso y acceso de los usuarios (en adelante, el “Usuario” o los “usuarios”) a todas las páginas web que figuran bajo el dominio [www.dominio.com] (en adelante, “la página”). La página y sus contenidos son propiedad y están gestionados por [Titular]','Siendo muy importante para [Titular Acrónimo] la seguridad, la garantía y protección de los datos personales que nos faciliten nuestros clientes, es conveniente que el Cliente lea la Política de Protección de Datos aplicable.','Las cookies son pequeños ficheros que se descargan en su terminal al acceder a determinadas páginas web que les permiten a éstas almacenar y recuperar información sobre los hábitos y preferencias del usuario.','CONDICIONES SEGÚN CONTRATO FIRMADO.','SEGÚN LA NORMATIVA RECOGIDA EN EL CONTRATO.',NULL,NULL);
