INSERT INTO `products` (`id_product`, `nombre`, `referencia`, `referencia_fab`, `id_subfamilia`, `men`, `woman`, `id_color`, `ref_color`, `id_marca`, `id_iva`, `precio`, `precio_iva`, `oferta`, `precio_promo`, `precio_promo_iva`, `desc_larga`, `id_tipo_talla`, `use_qty`, `visible`, `created_at`, `updated_at`) VALUES (1,'BOLSO TACTICO POLICIAL','121','121',8,0,0,992,'negro',2,2,47.67,49.11,0,0.00,0.00,'<p>BOLSO TACTICO POLICIAL.</p>\r\n\r\n<p>Bolsa t&eacute;cnica fabricada en nylon de 600D que ofrece al usuario m&uacute;ltiples bolsillos y compartimentos para disponer de todo su material de forma r&aacute;pida e intuitiva. La bolsa ha sido confeccionada pensando en el porte de los elementos m&aacute;s habituales tanto de los agentes de polic&iacute;a como de los tiradores profesionales o fot&oacute;grafos y reporteros, de forma acolchada y segura. Incluye bolsillos exteriores para cargadores, vainas, linternas, libretas, botellas de agua, etc&hellip; En su parte superior incluye unas trabillas para sujetar la defensa reglamentaria y un velcro hembra para poder adherir un r&oacute;tulo reflectante de identificaci&oacute;n como los LRE35. En el interior, detr&aacute;s de la tapa, incluye un apartado para poder llevar herramientas o bol&iacute;grafos y un bolsillo volum&eacute;trico, muy &uacute;til para piecer&iacute;a y/o peque&ntilde;os accesorios varios, como un timer, cron&oacute;metro, cargador, cargador de cargadores etc&hellip; El espacio interior es configurable. Se puede dejar en m&aacute;xima capacidad, o bien se puede colocar el separador interno que se sujeta mediante velcros, convirtiendo as&iacute; el espacio en 3 compartimentos, y evitando que los objetos se muevan. De este modo cada uno se acomoda el interior como mejor le vaya. Hay espacio suficiente para llevar 3-4 armas en su estuche original, cascos de protecci&oacute;n, protecciones, siluetas, c&aacute;maras fotogr&aacute;ficas, de video,... etc</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CARACTER&Iacute;STICAS T&Eacute;CNICAS</p>\r\n\r\n<ul>\r\n	<li>Fabricada 100% en Nylon 600D de alta resistencia. Paredes exteriores acolchados contra impactos.</li>\r\n	<li>Bolsillos exteriores con el&aacute;stico para adaptarse al objeto.</li>\r\n	<li>Bolsillo con ventana de polipropileno para poner el nombre o identificaci&oacute;n.</li>\r\n	<li>4 topes inferiores para evitar el contacto con el suelo.</li>\r\n	<li>Asa doble para trasporte en mano.</li>\r\n	<li>Correa para transporte en hombro.</li>\r\n	<li>Dimensiones: 55x40x33 cm.</li>\r\n	<li>Peso: 2,5kg.</li>\r\n</ul>',9,1,1,NULL,'2021-03-29 19:39:49'),(2,'CARTERA PORTADOCUMENTOS','225','225',9,0,0,992,'negro',2,2,18.53,19.09,0,0.00,0.00,'CARTERA PORTADOCUMENTOS',9,1,1,NULL,NULL),(3,'CASCO INTEVENCION','4','USIS G.',10,0,0,992,'negro',2,2,322.33,332.00,0,0.00,0.00,'CASCO INTERVENCION SEGURIDAD CIUDADANA',5,1,1,NULL,NULL),(4,'CASCO MOTORISTA','3','LS2',10,0,0,992,'negro',2,2,362.62,373.50,0,0.00,0.00,'CASCO MOTORISTO REGLAMENTO POLICIA LOCAL CANARIAS',5,1,1,NULL,NULL),(5,'CHALECO DE PROTECCION POLICIAL','828','828',11,0,0,992,'negro',9,2,529.54,545.43,0,0.00,0.00,'CHALECO ANTIBALAS',8,1,1,NULL,NULL),(6,'CHALECO REFLECTANTE','200','200',11,0,0,1,'amarrillo av + azul marino noche',2,2,24.17,24.90,0,0.00,0.00,'CHALECO REFLECTANTE. NORMA UNE EN 347',8,1,1,NULL,NULL),(7,'CINTURON POLICIAL','201','201',13,0,0,992,'negro',2,2,22.56,23.24,0,0.00,0.00,'',8,1,1,NULL,NULL),(8,'DEFENSA PERSONAL','827','827',14,0,0,992,'',2,2,148.16,152.61,0,0.00,0.00,'DEFENSA EXTENSIBLE- Peso (sin funda): 430g\n\n- Longitud en posición plegada: 210mm\n- Longitud en posición desplegada: 530mm/21\"\n- Diámetro de la empuñadura: 27,5mm\n\nDefensa extensible fabricada con materiales de alta calidad templados al calor, obteniendo de esta manera un acabado endurecido que evita deformaciones en caso de fuertes impactos.\nSu empuñadura antideslizante de goma tiene un diseño especial que aporta un mayor agarre reduciendo cualquier posibilidad de sustracción . Su composición de níquel - zinc en color negro ayuda a minorizar el desgaste por uso o rozamiento. \nSe suministra con la funda plástica BH-02 (patente europea EU Pat. No.: 1832834).',9,1,1,NULL,NULL),(9,'FUNDA DE ARMA','825','825',15,0,0,992,'negro',2,2,71.96,74.12,0,0.00,0.00,'',6,1,1,NULL,NULL),(10,'FUNDA DEFENSA EXTENSIBLE','828','828',16,0,0,992,'negro',4,2,16.93,17.44,0,0.00,0.00,'FUNDA DEFENSA EXTENSIBLE',9,1,1,NULL,'2021-02-02 09:09:32'),(11,'FUNDA GRILLETES','824','824',17,0,0,992,'negro',2,2,14.22,14.65,0,0.00,0.00,'FUNDA GRILLETES',9,1,1,NULL,NULL),(12,'FUNDA GRILLETES TCH ULTIMATE','82566','82566',17,0,0,992,'negro',2,2,22.56,23.24,0,0.00,0.00,'FUNDA GRILLETES TCH\n\nFunda diseñada para el grillete ULTIMATE. Material: cuero flor de primera calidad, funda abierta con presilla para el cinturón.\n\nCon cinta de sujeción y cierre por automático, que permite llevar los grilletes tanto abiertos como cerrados.',9,1,1,NULL,NULL),(13,'FUNDA SPRAY','823','823',18,0,0,992,'',2,2,6.12,6.31,0,0.00,0.00,'FUNDA SPRAY AUTODEFENSA.\n\nLa funda  es una de las más vendidas gracias a su polivalencia, no solo para albergar todo tipo de sprays de defensa, sino que también las mayoría de linternas de uso policial.\n\n \n\nSe fabrica en nylon balístico de 1000 Deniers, lo que le confiere un nivel de indestructibilidad excepcional. Incluye el sistema DVSS para adherirse al cinturón de dotación de forma rápida segura y sencilla.\n\n\nPosición fija vertical en ceñidor.\n\nCierre mediante velcro.\n\nColor: disponible en negro únicamente.',9,1,1,NULL,NULL),(14,'SPRAY DE AUTODEFENSA','823','823',18,0,0,907,'Rojo',2,2,22.57,23.25,0,0.00,0.00,'SPRAY DE AUTODEFENSA• Tipo de disparo: Chorro balístico.\n\n• Fórmula Activa: 10% OC + 1,33% Capsaicinoides (pimienta) de mayor efecto incapacitante.\n• Efecto inmediato sobre el agresor, con incapacitación instantánea durante 45 minutos sin efectos secundarios para su salud.\n• Capacidad para disparar hasta 15 disparos de 1 segundo.\n• Cantidad expulsada en cada disparo: +-1,7gr de OC.\n• Alcance mediante chorro balístico hasta una distancia de 5 metros. \n• Cuando dispara, no se esparce y no se vaporiza, incluso a contra-viento. \n• Sólo actúa sobre el agresor. \n• Dispara perfectamente desde cualquier posición, inclinado e incluso invertido. \n• Incluye un compuesto ultravioleta (UV) invisible que marca al agresor y que permite identificarlo hasta 48h después.\n• No produce efectos secundarios en el agresor. \n• Seguro protector contra disparo accidental. \n• Puede dejarse en vehículo al sol hasta altas temperaturas. \n• No contamina y protege la capa de Ozono. \n• No es explosivo ni inflamable y es compatible con defensas eléctricas. \n• Tamaño de bolsillo. Medidas: 10 X 1.6 cm de diámetro, con pinza de sujeción.',9,1,1,NULL,NULL),(15,'GANCHO PORTA CASCO','615','615',19,0,0,992,'Negro',2,2,5.64,5.81,0,0.00,0.00,'GANCHO PORTA CASCO.Soporte tipo llavero para llaves, accesorios, silbato, casco y/o demas accesorios.\n\n\nFabricado en acero de primera calidad y de gran resistencia.\n\nColor disponbile en negro unicamente.',9,1,1,NULL,NULL),(16,'GRILLETES','606','606',20,0,0,986,'gris',2,2,56.00,57.69,0,0.00,0.00,'GRILLETE BISAGRA.\n\nTipo de unión: Bisagra\nCerradura: Doble\nLlave: Standard\nFabricación: Remachado\nMecanismo: Doble cierre tratado\nDentado: Doble\nPeso: 340 grs\nLongitud: 215 mm\nApertura mínima: 50 mm\nPerímetro interior mínimo: 165 mm\nPerímetro interior máximo: 200 mm\nPosiciones de cierre: 20\nMaterial: Acero K-70\nDureza: Rockwell B HRB-95\nGrosor Plegado: 20 mm\n\nCertificado: NIJ Standard — 0307.01',9,1,1,NULL,NULL),(17,'GRILLETES ULITMATE','8256','8256',20,0,0,986,'gris',10,6,82.31,99.60,0,0.00,0.00,'GRILLETES TCH Los ULTIMATE con sistema de apertura en los dos lados son los grilletes de ultima generación y mas avanzados de uso policial hoy en día, con sistema de precarga y doble seguro. Al ser plegables son fáciles y cómodos de portar, y al convertirse en rígidos cumplen la misma función que los grilletes SPEEDCUFF.\n\nEstán sobredimensionados un 17% para muñecas grandes. Acabado en níquel. Peso: 455 grs y con 25 posiciones de cierre.\n\nCumple todos los requisitos de resistencia exigidos por la Norma NIJ 0307.01, excediendo en 50 grs el peso estándar.',9,1,1,NULL,NULL),(18,'GUANTE ANTICORTE','610','610',21,0,0,992,'negro',2,2,33.03,34.03,0,0.00,0.00,'GUANTE ANTICORTE NIVEL V.\n\n membrana anti-corte CutLess®, cumple con las expectativas con un ratio rendimiento/precio excepcional.\n\n \n\nLa delgada y comodísima membrana con resistencia al corte supera el máximo nivel 5, con una composición de poliamida, polietileno y fibra de vidrio. La membrana anti-corte cubre la totalidad del guante y se cose con hilo de Aramida de 3-ply para garantizar su protección homogénea y su fijación.\n\n \n\nEl guante, es un guante increíblemente liviano, transpirable, diseñado ergonómicamente, forrado y confeccionado únicamente con tejidos técnicos avanzados para poder ofrecer el máximo nivel de calidad y efectividad.\n\n \n\nEl dorso del guante está formado por una combinación de tejidos poliamidas bi-elásticos y Neopreno para garantizar la máxima flexibilidad y transpirabilidad. Las costuras son siempre planas y paralelas con una densidad de entre 4 y 5 puntadas por cm., con hilo de Nylon de 2-ply, para que jamás molesten al usuario.\n\n \n\nEn la palma del guante, incorpora el tejido AMARA®, que aporta sin lugar a dudas una enorme resistencia a la abrasión, de modo y en una sola pieza, protege toda la palma hasta la zona de las uñas de los dedos por la parte del dorso, ya que esa es una zona con mucho desgaste.\n\n \n\nEntre los dedos, el tejido bi-elástico cortado ergonómicamente con un ángulo de unos 25º aproximadamente, proporciona una comodidad añadida, puesto que se adapta al tamaño o grosor de los dedos del usuario y a la forma de estos, que es ligeramente curvado en reposo.\n\n \n\nAdicionalmente y para asegurar un buen agarre del arma o bastón del Policía, incluso en mojado, hemos añadido un tejido de poliuretano más, con grabado anti-deslizante a base de silicona injertada en la palma.\n\n \n\nA pesar de las múltiples capas de protección que incorpora el guante, éste sigue permitiendo el libre movimiento de la mano con un nivel de tacto y desteridad sin iguales.\n\n\nLas pruebas a las que se sometido, le han otorgado los siguientes niveles:\n\nNivel 2 en resistencia a la abrasión, correspondiente a 8000 ciclos, nivel 5 en resistencia al corte por cuchilla, correspondiente a índice 20, nivel 4 de resistencia al rasgado, correspondiente a 75N y nivel 4 en cuanto a la resistencia a la perforación, correspondiente a 150N.\nAlcanza el nivel 5 en desteridad y en las pruebas de permeabilidad al vapor de agua, supera el mínimo de 5mg/cm2 por hora de transmisión, mientras que la absorción de vapor de agua es de solo 8mg/cm2 para 8h.',8,1,1,NULL,NULL),(19,'GUANTE MOTORISTA','605','605',21,0,0,992,'negro',2,2,40.29,41.50,0,0.00,0.00,'GUANTE MOTORIST\n\nAGuantes con protecciones de fibra de carbono, lo que asegura la máxima protección en situaciones de riesgo.\n\n\nMuñecas y nudillos reforzados con foam inyectado y protección de fibra de carbono.\n\nCostura reforzada doble y muñequera elástica.\n\n\nCierres de velcro.',8,1,1,NULL,NULL),(20,'DISTINTIVO DE BRAZO ','903','903',22,0,0,538,'',2,2,3.63,3.74,0,0.00,0.00,'DISTINTIVO DE BRAZO POLICIAL CANARIAS',9,1,1,NULL,NULL),(21,'DISTINTIVO DE BRAZO MUNICIPAL','903','903',22,0,0,538,'',2,0,3.63,3.74,0,0.00,0.00,'DISTINTIVO DE BRAZO MUNICIPAL',9,1,1,NULL,NULL),(22,'GALONES DE PECHO','700','700',22,0,0,538,'azul marino noche',2,2,2.82,2.91,0,0.00,0.00,'GALONES DE PECHO. REGLAMENTO POLICIA LOCAL CANARIAS. ESCALA POLICIAL.',4,1,1,NULL,NULL),(23,'GALONES PARA HOMBRERAS','701','701',22,0,0,538,'azul marino noche',2,2,6.44,6.64,0,0.00,0.00,'GALONES PARA HOMBRERAS. REGLAMENTO POLICIA LOCAL CANARIAS',9,1,1,NULL,NULL),(24,'PLACA DE PLASTICO ','901','901',22,0,0,942,'',2,2,2.41,2.49,0,0.00,0.00,'PL